import * as React from 'react';
import './counter.css'

export default function Counter({ counter }) {
    return (
        <div class='count'>
            <a class="btn-floating enabled"><i class="material-icons">remove</i></a>
            <div>
                {counter}
            </div>
            <a class="btn-floating enabled"><i class="material-icons">add</i></a>
        </div>
    )
}


// Si usamos export default, no es necesario importarlo como { componente } en App.js
